import React from 'react';
import './Card.css';

const Card = ({ children, title, ...props }) => {
    return (
        <div className="card" {...props}>
            {title && (
                <div className="card-header">
                    <h3 className="card-title">{title}</h3>
                </div>
            )}
            <div className="card-content">
                {children}
            </div>
        </div>
    );
};

export default Card;
